import React from "react";
import Logo from "../images/logo222 1.png";
class NavBar extends React.Component {
  render() {
    return (
      <div
        className={
          "fixed bg-red-00 w-screen flex justify-between py-5 px-5 md:px-10 bg-gray-300 bg-opacity-30 items-center text-" +
          this.props.color
        }
      >
        <div>
          <img src={Logo} alt="app-logo" className="w-20" />
        </div>
        {/* nav-list */}
        <div className="hidden md:inline text-lg">
          <span className="px-5">Home</span>
          <span className="px-5">Services</span>
          <span className="px-5">Products</span>
          <span className="px-5">About Us</span>
          <span className={"px-5 border-l-2 border-" + this.props.color}>
            Sign in
          </span>
        </div>
        {/* Ham */}
        <svg
          xmlns="http://www.w3.org/2000/svg"
          height="70px"
          viewBox="0 0 24 24"
          width="50px"
          fill={this.props.color}
          className="md:hidden"
        >
          <path d="M0 0h24v24H0z" fill="none" />
          <path d="M3 18h18v-2H3v2zm0-5h18v-2H3v2zm0-7v2h18V6H3z" />
        </svg>
      </div>
    );
  }
}

export default NavBar;
